import React, {FC} from "react";

type EditableSpanPropsType = {
    title: string
}
const EditableSpan: FC<EditableSpanPropsType> = ({title}) => {
    return (
        <div>
            <span>{title}</span>

        </div>
    );
};

export default EditableSpan;
